/* No decompiler yet implemented for arm32 */
TempoTable* CSoundManager::GetTempoStrm(u32 id) { //not sure if STRM or SEQ
    for (s32 low = 0, high = unk98; low <= high;) {
        u32 r0 = low + high;
        r0 = (s32)r0 / 2;
        SoundManager_90* r12 = &unk90[r0];
        if (r12->id > id) high = r0 - 1;
        if (r12->id < id) low = r0 + 1;
        if (r12->id == id) return r12->tempo;
    }
    return 0;
}

